// 해당 위치에 필요한 컴포넌트를 바탕으로 직접 Bootstrap Album 페이지를 개발하시면 됩니다.
import React from "react";
import Example from "./components/example";
import Main from "./components/main";
import Main2 from "./components/main2";
import Main3 from "./components/main3";




function App() {
  return <>
  <Example exampleText="Album example"/>
  
  <Main /*cardTitle="You Are My Universe" */cardContent="This is a wider card with supporting 
  text below as a natural lead-in to additional
   content. This content is a little bit longer." imgUrl1="./image/lhf.jpg"
   /*cardTitle2="Thumbnail"*/ cardContent2="This is a wider card with supporting 
   text below as a natural lead-in to additional
    content. This content is a little bit longer." imgUrl2="./image/nah.jpg"
    /*cardTitle3="Thumbnail"*/ cardContent3="This is a wider card with supporting 
  text below as a natural lead-in to additional
   content. This content is a little bit longer." imgUrl3="./image/silcagel.jpg"/>

<Main2 /*cardTitle="Thumbnail"*/ cardContent="This is a wider card with supporting 
  text below as a natural lead-in to additional
   content. This content is a little bit longer." imgUrl4="./image/lucy.jpg"
   /*cardTitle2="Thumbnail"*/ cardContent2="This is a wider card with supporting 
   text below as a natural lead-in to additional
    content. This content is a little bit longer." imgUrl5="./image/mgff.jpg"
   /* cardTitle3="Thumbnail" */cardContent3="This is a wider card with supporting 
  text below as a natural lead-in to additional
   content. This content is a little bit longer." imgUrl6="./image/wavy.jpg"/>

<Main3 /*cardTitle="Thumbnail"*/ cardContent="This is a wider card with supporting 
  text below as a natural lead-in to additional
   content. This content is a little bit longer." imgUrl7="./image/surl.jpg"
   /*cardTitle2="Thumbnail"*/ cardContent2="This is a wider card with supporting 
   text below as a natural lead-in to additional
    content. This content is a little bit longer." imgUrl8="./image/offthemenu.jpg"
    /*cardTitle3="Thumbnail" */cardContent3="This is a wider card with supporting 
  text below as a natural lead-in to additional
   content. This content is a little bit longer." imgUrl9="./image/55.jpg"/>


  
  </>;
}

export default App;
